import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Test from "./components/Test";
import WordMeaning from "./components/WordMeaning/WordMeaning";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Route path="/" component={Test} />
        <WordMeaning />
      </div>
    </BrowserRouter>
  );
}

export default App;
